	const val="not"
	if(props.location.state == null){
		return <Redirect to='/'/>
	}
	else{
		const formData = new FormData();
		var name="";
		var surname="";
		var Email_Address=props.location.state.Email
		var Phone_Number="";
		var Biography="";
		var Professional_Experience="";
